# Without using a function
with open("dopamine_information1.csv", "w") as outfile:
    outfile.write("sequenceID,sequenceLength\n")
    
    for id in dopamine_dict:
        outfile.write(id + "," + str(len(dopamine_dict[id])) + "\n")


# here is the function to use for modifying above!
def write_to_csv(header, d, file):
    outfile = open(file, "w")

    outfile.write(header + "\n")
    
    for item in d:
        outfile.write(item + "," + str(len(d[item])) + "\n")

    outfile.close()
            
            
# and here is the function being used:
write_to_csv("sequenceID,sequenceLength", dopamine_dict, "dopamine_information2.csv")
 
 
 
# the second way to modify the function - now prints percentage of ambiguous nucs as third column
def write_to_csv2(header, d, file):
    outfile = open(file, "w")

    outfile.write(header + "\n")
    
    for item in d:
        percent = float(d[item].count("N")) / len(d[item])
        outfile.write(item + "," + str(len(d[item])) + "," + str(percent) + "\n")
    
    outfile.close()
    

        
# and here is the function being used:
write_to_csv2("sequenceID,sequenceLength,percentAmbig", dopamine_dict, "dopamine_information3.csv")
 

        
    